import styles from './style.module.css'
import {useState, useEffect} from "react";


function Clock() {
    let time = new Date();
    const [times, setTimes] = useState([]);
    useEffect(() => {
        setTimes([time.getHours(), time.getMinutes(), time.getSeconds()]);
        },[])
    return(
        <div>
            {String(times[0]).padStart(2,'0')}
        </div>
    )
}
function App() {
  return (
      <div>
          <Clock/>
      </div>
  );
}

export default App;
